  console.log(data.ArticleId);
  console.log(data.PartyId);

  try {
    return await axios.post(
      `${url}/getCartArticleDetails?ArticleId=${data.ArticleId}&PartyId=${data.PartyId}`
    );
  } catch (error) {
    console.log("err in react api", error);
  }
};

